#include <fuzzer/FuzzedDataProvider.h>

#include <aconf.h>
#include <stddef.h>
#include <stdint.h>
#include <vector>

#include "GString.h"
#include "GlobalParams.h"
#include "PDFDoc.h"
#include "config.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  int page = fdp.ConsumeIntegral<int>();
  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeIntegral<GBool>();
  GBool crop = fdp.ConsumeIntegral<GBool>();
  GBool printing = fdp.ConsumeIntegral<GBool>();
  int sliceX = fdp.ConsumeIntegral<int>();
  int sliceY = fdp.ConsumeIntegral<int>();
  int sliceW = fdp.ConsumeIntegral<int>();
  int sliceH = fdp.ConsumeIntegral<int>();
  std::vector<char> buf = fdp.ConsumeRemainingBytes<char>();

  //ancestry_buffer= {0};

  globalParams = new GlobalParams(NULL);

  Object obj;
  obj.initNull();
  MemStream *str = new MemStream(buf.data(), 0, buf.size(), &obj);
  PDFDoc *doc = new PDFDoc(str, NULL, NULL, NULL);

  if (doc->isOk()) {
    doc->displayPageSlice(NULL, page, hDPI, vDPI, rotate, useMediaBox, crop, printing, sliceX, sliceY, sliceW, sliceH, NULL, NULL);
  }

  delete doc;
  delete globalParams;

  return 0;
}

#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>
#include <vector>

#include "GfxState.h"
#include "GlobalParams.h"
#include "Object.h"
#include "PDFDoc.h"
#include "Stream.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  int pageNum = fdp.ConsumeIntegral<int>();
  double hDPI = fdp.ConsumeFloatingPointInRange<double>(0.0, 1000.0);
  double vDPI = fdp.ConsumeFloatingPointInRange<double>(0.0, 1000.0);
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeBool();
  GBool crop = fdp.ConsumeBool();
  GBool printing = fdp.ConsumeBool();
  int sliceX = fdp.ConsumeIntegral<int>();
  int sliceY = fdp.ConsumeIntegral<int>();
  int sliceW = fdp.ConsumeIntegral<int>();
  int sliceH = fdp.ConsumeIntegral<int>();
  std::vector<char> payload = fdp.ConsumeRemainingBytes<char>();

  Object obj;
  obj.initNull();
  MemStream *stream = new MemStream(payload.data(), 0, payload.size(), &obj);

  PDFDoc *doc = NULL;
  try {
    doc = new PDFDoc(stream);
    if (doc->isOk() == gTrue) {
      OutputDev *output_dev = nullptr;
      doc->displayPageSlice(output_dev, pageNum, hDPI, vDPI, rotate, useMediaBox, crop, printing, sliceX, sliceY, sliceW, sliceH, NULL, NULL);
    }
  } catch (...) {}

  delete doc;

  return 0;
}
